import React from 'react'
import {
  Divider
} from "@material-ui/core";
import './style.css'
import {SideBarData} from './sideBarData'

export class index extends React.Component {
	render() {
		return (
			<div className="conte">
				<div className="sidebar">
					<ul className="sidebarList">
						<li className="row">
							<div id="icon">
								<Menu />
							</div>
							<div id="title">
								Menu
							</div>
						</li>
						{SideBarData.map((val,key) =>{
							return(
								<li key={key} 
								className="row"
								//id={val.link ? "active" : ""}
								onClick={()=> val.link}
								 >
									<div id="icon">
										{val.icon}
									</div>
									<div id="title">
										{val.title}
									</div>
								</li>
							)
						})}
						<Divider />
					</ul>
				</div>
			</div>
		)
	}
}

export default index
